                    <li><a href="#">Contact</a></li>
                  </ul>
                </div>
                <div id="Mobile" onClick={this.handleClick}>
                  <i
                    id="bar"
                    className={this.state.clicked ? 'fas fa-times' : 'fas fa-bars'}
                    onClick={this.handleClick}
                  ></i>
                </div> */}


          



            {/* <FaLinkedin />
            <FaGithub />
            <FaInstagramSquare/>
            <FaSquareXTwitter/> */}
          </div>
        </div>
      </>
    );
  }
}



export default Navbar;
